import Head from 'next/head'

import Navbar from './Navbar'

const Layout = (props) => (
  <>
  <Head>
    <title>SuperHero</title>    
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css"/>
    <link href="https://fonts.googleapis.com/css2?family=Open+Sans:ital,wght@0,300;0,400;0,600;0,700;0,800;1,300;1,400;1,600;1,700;1,800&display=swap" rel="stylesheet"></link>
  
    <style>
    {`
      @font-face {
        font-family: 'Open Sans';
        src: url('https://fonts.googleapis.com/css2?family=Open+Sans:ital,wght@0,300;0,400;0,600;0,700;0,800;1,300;1,400;1,600;1,700;1,800&display=swap');
      }

      body {
        font-family: 'Open Sans', sans-serif;
      }
    `}
  </style>
  
  
  
  </Head>
  <Navbar/>
  {props.children}
  </>
)

export default Layout;
